/*
 * @file
 * Fundedvisual js
 *
 * Js behaviours for fundedvisual theme. All functionality just enhances default behaviour so that disabling javacript
 * does not destoy the app.
 */

(function ($) {

  "use strict";

  Drupal.theme.prototype.Tab = function (name) {
    // Create an anchor element with jQuery.
    return $('<li class="js-crowdfunding-comments"><a href="">' + name + '</a></li>');
  };

  /**
   * Adds the homepage flexslider behaviour
   */
  Drupal.behaviors.HomeHeaderFix = {
    attach: function (context, settings) {
      $(".front", context).once('home-header-fixed', function () {
        $(document).ready(function(){
          var navbar = $(".navbar-default", context),
            hero_region = $(".region-hero");
          var position = hero_region.offset().top + hero_region.height();

          $(window).scroll(function () {

            var scrollTop = document.documentElement.scrollTop || document.body.scrollTop;

            if(position){
              if(scrollTop > position && !navbar.is(".scroll-down")) {
                navbar.addClass("scroll-up");
                setTimeout(function(){
                  navbar.removeClass("scroll-up");
                  navbar.addClass("fixed scroll-down");
                },100);
              }
              else if(scrollTop == 0 && navbar.is(".scroll-down") ) {
                navbar.removeClass("fixed").removeClass("scroll-up").removeClass("scroll-down");
              }
            }

          });
        });
      });
    }
  };

  Drupal.behaviors.mobileTabs = {
    attach: function (context, settings) {
      // By using the 'context' variable we make sure that our code only runs on
      // the relevant HTML. Furthermore, by using jQuery.once() we make sure that
      // we don't run the same piece of code for an HTML snippet that we already
      // processed previously. By using .once('unicheck') all processed elements will
      // get tagged with a 'unicheck-processed' class, causing all future invocations
      // of this behavior to ignore them.

      $('.main-container .tabs-wrapper').once('funded-tabs--mobile', function() {
        var $tabs = $(".main-container .tabs--primary", context),
          $tabs_toggle = $(".tabs_mobile--toggle", context),
          $tabs_wrapper = $(".tabs-wrapper");

        var title = $tabs.find("a.active").html() ? $tabs.find("a.active").html() : "";

        title != "" ? $tabs_toggle.find("span").html(title) : null;

        if(!$tabs.length){
          $tabs_wrapper.hide();
        }

        //Add a switcher
        $($tabs_toggle).on("click", function(){

          $tabs.toggle();
          $tabs_toggle.toggleClass("closed");
        });
      });
    }
  };

  /*
  * Adds the user menu behaviour via javascript.
  * 1 - Adds the menu into the user--menu placeholder
  * 2 - Adds on click event to the user picture
  */

  Drupal.behaviors.fundedvisualUserMenu = {

    attach: function(context, settings){
      $('.navbar-default', context).once('fundevisual-user-picture', function () {

        var $secondary_menu = $(".navbar-nav.secondary"),
          $user_menu_placeholder = $(".user--menu"),
          $user_picture_menu = $(".navbar .user-image"),
          $user_picture_wrapper = $(".navbar .user-image");

        $user_menu_placeholder.append($secondary_menu);

        $user_picture_menu.click(function(e){

          $user_picture_wrapper.toggleClass("js-user-menu--clicked");

          $user_menu_placeholder.toggle();

          e.preventDefault();

        });

      });
    }

  };

  /**
   * Puts comments in a new tab and adds behaviour for the tab to switch content to comments
   */
  Drupal.behaviors.fundevisualProjectComments = {
    attach: function (context, settings) {
      $('.crowfunding-project .main-container', context).once('crowdfunding-project-comments', function () {

        var tabs = $(".tabs--primary", context),
          comments = $(".pane-node-comment-wrapper", context),
          content = $(".pane-node-body,.pane-node-field-images"),
          view_tab = ".tabs--primary li:first a",
          comments_tab = ".js-crowdfunding-comments a";

        if(comments.find("#comments").children().length){
          tabs.append(Drupal.theme("Tab", Drupal.t("Comments")));
        }

        comments.hide();

        //Click on comments tab
        $(document).on("click", comments_tab, function (e) {
          e.preventDefault();

          $(view_tab).removeClass("active")
          $(view_tab).parent().removeClass("active");

          $(comments_tab).addClass("active");
          $(comments_tab).parent().addClass("active");

          content.hide();
          comments.show();

          $('html, body').animate({scrollTop: comments.offset().top - 130}, 500);
        });

        //Click on view tab
        $(document).on("click", view_tab, function (e) {
          e.preventDefault();

          $(view_tab).addClass("active")
          $(view_tab).parent().addClass("active");

          $(comments_tab).removeClass("active");
          $(comments_tab).parent().removeClass("active");

          content.show();
          comments.hide();
        });

      });
    }
  };


  /**
   * Adds the homepage flexslider behaviour
   */
  Drupal.behaviors.homepageFlexslider = {
    attach: function (context, settings) {
      $('.view-flexslider-slideshow', context).once('homepage-flexslider', function () {

        $('.flexslider', context).flexslider();

      });
    }
  };

  /**
   * Adds the homepage flexslider behaviour
   */
  Drupal.behaviors.generalFlexslider = {
    attach: function (context, settings) {
      $('body', context).once('flexslider', function () {

        $('.flexslider', context).flexslider();

      });
    }
  };

  /**
   * Adds the homepage flexslider behaviour
   */
  Drupal.behaviors.homepageClients = {
    attach: function (context, settings) {
      $("#owl-clients", context).once('homepage-clients-carousel', function () {

        $("#owl-clients", context).owlCarousel({
          itemsDesktop : [1920,5],
          itemsDesktopSmall : [980,3],
          itemsTablet: [768,2],
          itemsTabletSmall: false,
          itemsMobile : [479,1],
          singleItem : false,
          itemsScaleUp : false,
          theme:"owl-theme",
          autoPlay : 5000
        });

      });
    }
  };

  /**
   * Adds the homepage flexslider behaviour
   */
  Drupal.behaviors.homepageProjects = {
    attach: function (context, settings) {
      $("#owl-projects", context).once('homepage-projects-carousel', function () {

        $("#owl-projects", context).owlCarousel({
          itemsDesktop : [1920,3],
          itemsDesktopSmall : [980,3],
          itemsTablet: [768,2],
          itemsTabletSmall: false,
          itemsMobile : [479,1],
          singleItem : false,
          itemsScaleUp : false,
          theme:"owl-theme",
          navigation: true,
          navigationText : false,
          autoPlay : 8000
        });

      });
    }
  };

  /**
   * Adds the homepage flexslider behaviour
   */
  Drupal.behaviors.rewardsPopup = {
    attach: function (context, settings) {
      $(".node-type-crowdfunding-project", context).once('project-row-backproject-popup', function () {
        $(document).ready(function(){

          var rewards = $(".back_project--link", context),
            panel_rewards = $('.pane-project-rewards .pane-content', context),
            rewards_modal_body = $('#ProjectRewardsModal').find('.modal-body');
          rewards.attr("href","#");

          rewards_modal_body.append(panel_rewards.html());


        });
      });
    }
  };

  /**
   * Adds the homepage flexslider behaviour
   */
  Drupal.behaviors.ProjectHeaderFix = {
    attach: function (context, settings) {
      $(".project-row--actions", context).once('project-header-fixed', function () {
        $(document).ready(function(){
          var navbar = $(".project-row--actions", context);
          var navPosition = navbar.offset().top;

          $(window).scroll(function () {

            var scrollTop = document.documentElement.scrollTop || document.body.scrollTop;

            if(navPosition){
              if(scrollTop > navPosition && !navbar.is(".fixed")) {
                navbar.addClass("fixed");
              }
              else if(scrollTop < navPosition && navbar.is(".fixed") ) {
                navbar.removeClass("fixed");
              }
            }

          });
        });
      });
    }
  };

})(jQuery);
;
